import React, { useEffect, useState } from "react";
import "./Components.css";

class TableFilter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div style={{ borderStyle: "solid", borderWidth: "10px", width: "80%" }}>
        <ProgramFilter />
        <AreaFilter />
        <PrecisionFilter />
      </div>
    );
  }
}

function ProgramFilter() {
  return (
    <div className="filterBox">
      <h3>ProgramFilter</h3>
    </div>
  );
}

function AreaFilter() {
  return (
    <div className="filterBox">
      <h3>AreaFilter</h3>
    </div>
  );
}

function PrecisionFilter() {
  return (
    <div className="filterBox">
      <h3>PrecisionFilter</h3>
    </div>
  );
}

export default TableFilter;
